    },
    {
        nqh_productId:"P003"
        , nqh_productName:"IPhone 13"
        ,  nqh_quantity:10
        , nqh_price:1500

                }

            ]
        }
    }
    render() {
        return (
            <div>
                <h1>Nguyễn Quang Huy</h1>
                <hr/>
                <nqh_Products/>
            </div>
        );
    }
}

export default App;
